import Leaf from 'leaflet';
import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup, Tooltip } from 'react-leaflet';
import GPSMap from './leaflet';

const GPSmap2 = () => {
  const [position, setPosition] = useState([51.505, -0.09]); // Default position
  const socket = new WebSocket('ws://204.12.199.7:9999/ws');

  const customIcon = new Leaf.Icon({
    // iconUrl:  "https://freepngimg.com/thumb/car/75694-bird's-eye-car-top-view,plan-view-icon.png",
    iconUrl:require('./car.png'),
    iconSize: [35, 35],
    iconAnchor: [12, 41],
    popupAnchor: [1, -34],
    tooltipAnchor: [16, -28],
  });


    socket.onopen = () => {
      console.log('WebSocket connected');
    };

    socket.onmessage = (event) => {
      const data = JSON.parse(event.data);
      // setPosition([data.latitude, data.longitude]);
      console.log(data);
      
    };

    socket.onclose = () => {
      console.log('WebSocket disconnected');
    };

  return (
    <div className="map-container">
     <MapContainer center={position} zoom={13} style={{ height: '100vh', width: '100%' }} className='map'
       minZoom={3}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        />
      <Marker position={position} icon={customIcon}>
        
      <Popup autoClose={false} closeButton={false} autoPan={false}>
            <div style={{ display: 'flex', alignItems: 'center' }}>
              <img src="icon.png" alt="Icon" style={{ width: '24px', height: '24px', marginRight: '8px' }} />
              <span>Marker Text</span>
            </div>
          </Popup>
        <Tooltip direction="top" offset={[0, -20]}>
            Marker Text
          </Tooltip>
      </Marker>
    </MapContainer>  
    </div>
   
  );
};

export default GPSmap2;
